import React from "react";
import { Link } from "react-router-dom";

const NavBar = () => {
  return (
    <nav className="navbar navbar-dark bg-dark">
      <span className="navbar-brand mb-0 h1">Vidly</span>
      <thead>
        <tr>
          <th>
            <Link to="/movies" className="clickable">
              Movies
            </Link>
          </th>
          <th>
            <Link to="/customers" className="clickable">
              Customers
            </Link>
          </th>
          <th>
            <Link to="/rentals" className="clickable">
              Rentals
            </Link>
          </th>
        </tr>
      </thead>
    </nav>
  );
};

export default NavBar;
